import React, { Component } from 'react';
class startpage extends Component {
   
    styles=
    {
        'box':{'background-color':'brown','width':100,'hieght':100},
        'text':{'color':'pink'}
    };
    render() {
        return (
            <div style={this.styles.box}>
            <h1 style={this.styles.text}>hi hello</h1>
            </div>
        );
    };

}
export default startpage;
